import { useState } from 'react';
import Child from './Child';

const Parent = () => {
    const [childData, setChildData] = useState("");

    function updateChildData(data) {
        setChildData(data)
    }   

    return (
        <div className='w-100 d-flex-col align-items-center'>
            <h1>Parent Div</h1>
            <p>Content from Child Div: {childData}</p>
            <Child updateParent={updateChildData} />
        </div>
    );  
};

export default Parent;
